import './App.css';
import Navigation from './componenets/navigation/Navigation';
import Logo from './componenets/logo/Logo';
import Rank from './componenets/rank/rank'
import ImageLink from './componenets/imageLink/imageLink';
import Particles from 'react-particles-js';
import { Component } from 'react';
import Clarifai from 'clarifai-nodejs-grpc';
import FaceReco from './componenets/face';

const particleOptions = {
  particles: {
    number: {
      value: 30,
      density: {
        enable: true,
        value_area: 8000
      }
    }
  }
}

//const { ClarifaiStub, grpc } = require("clarifai-nodejs-grpc");

//const stub = ClarifaiStub.grpc();

//const metadata = new grpc.Metadata();
//metadata.set("authorization", "8574ae4ec5094e459de26dbf89fe7742");

const app = new Clarifai.App({
  apikey: '8574ae4ec5094e459de26dbf89fe7742'
});

class App extends Component {

  constructor() {
    super();
    this.state = {
      input: '',
    }
  }


  onInputChange = (event) => {
    console.log(event);
  }

  onButtonSubmit = () => {
    stub.PostModelOutputs(
      {
        // This is the model ID of a publicly available General model. You may use any other public or custom model ID.
        model_id: "aaa03c23b3724a16a56b629203edc62c",
        inputs: [{ data: { image: { url: "https://samples.clarifai.com/dog2.jpeg" } } }]
      },
      metadata,
      (err, response) => {
        if (err) {
          console.log("Error: " + err);
          return;
        }

        if (response.status.code !== 10000) {
          console.log("Received failed status: " + response.status.description + "\n" + response.status.details);
          return;
        }

        console.log("Predicted concepts, with confidence values:")
        for (const c of response.outputs[0].data.concepts) {
          console.log(c.name + ": " + c.value);
        }
      }
    );

  };

  render() {

    return (
      <div className="App" >

        <Particles className='particles' />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLink onInputChange={this.onInputChange} onSubmit={this.onButtonSubmit} />
        <FaceReco />

      </div>
    );
  }
}

export default App;
